INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-00-748384-6', 'A Storm of Swords', '19.99', 'Fantasy', , 2, 'Split into two books for the paperback, the third volume in George R.R. Martin''s superb and highly acclaimed epic fantasy A Song of Ice and Fire continues the richest, most exotic and mesmerising saga since The Lord of the Rings. The Seven Kingdoms are divided by revolt and blood feud, and winter approaches like an angry beast. Beyond the Northern borders, wildlings leave their villages to gather in the ice and stone wasteland of the Frostfangs. From there, the renegade Brother Mance Rayder will lead them South towards the Wall. Robb Stark wears his new-forged crown in the Kingdom of the North, but his defences are ranged against attack from the South, the land of House Stark''s enemies the Lannisters. His sisters are trapped there, dead or likely yet to die, at the whim of the Lannister boy-king Joffrey or his depraved mother Cersei, regent of the Iron Throne. And Daenerys Stormborn will return to the land of her birth to avenge the murder of her father, the last Dragon King on the Iron Throne. ');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-30774-365-7', 'The Shining', '17.99', 'Horror', , 4, 'Ghostly bursts of plaster dust. A low, rhythmic sound in the background: Red rum-RED RUM-red rum-RED RUM. A sense of something evil swirling inward on itself, like a whirlpool of black ectoplasmic energy. The experience of being inside the actual consciousness ("come out and take your medicine!") of a frightened little boy. Echoes of Shirley Jackson ("whatever walked there, walked alone"), of Poe''s Masque of the Red Death and of creepy folk tales (Hansel and Gretel). \r\n\r\nHow do we love The Shining? Let us count the ways. In 1977, The Shining was the first widely read novel to confront alcoholism and child abuse in baby-boomer families--especially the way alcoholism, a will toward failure in one''s work, and abusing one''s kids are passed down from generation to generation. The heart of the book is not an evil hotel but a pair of father-son relationships: Jack and his father, Jack and his son. This was both daring and insightful for its time, long before "dysfunctional family" was a cliché. \r\n\r\nThe Shining was written in a frenzy. Stephen King imagined the whole novel in his head while sitting up all night in the dark, in the very Colorado hotel where the story takes place. He then transcribed it (that''s how he puts it) in a burst of sustained energy. He could pull that off because, even at that early point in his career, King had figured out a successful way of structuring a popular novel. The speed of its composition gives the writing a powerful flow that sweeps you along past the awkward wording. \r\n\r\nThe Shining is one of those rare novels that can burn its images--such as Room 217--into your brain. Time alone will tell, but The Shining may well turn out to be one of the best horror novels ever written. By the way, you know that film starring Jack Nicholson? Stephen King says, "I have my days when I think I gave Kubrick a live grenade on which he heroically threw his body." --Fiona Webster --This text refers to an out of print or unavailable edition of this title. \r\n');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-34539-180-3', 'The Hitchhiker''s Guide to the Galaxy', '19.99', 'Science Fiction', , 8, 'Join Douglas Adams''s hapless hero Arthur Dent as he travels the galaxy with his intrepid pal Ford Prefect, getting into horrible messes and generally wreaking hilarious havoc. Dent is grabbed from Earth moments before a cosmic construction team obliterates the planet to build a freeway. You''ll never read funnier science fiction; Adams is a master of intelligent satire, barbed wit, and comedic dialogue. The Hitchhiker''s Guide is rich in comedic detail and thought-provoking situations and stands up to multiple reads. Required reading for science fiction fans, this book (and its follow-ups) is also sure to please fans of Monty Python, Terry Pratchett''s Discworld series, and British sitcoms. ');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-34540-447-3', 'Do Androids Dream of Electric Sheep?', '13.99', 'Science Fiction', , 6, 'Do Androids Dream of Electric Sheep? is a book that most people think they remember, and almost always get more or less wrong. Ridley Scott''s film Blade Runner took a lot from it, and threw a lot away; wonderful in itself, it is a flash thriller where Dick''s novel is a sober meditation. As we all know, bounty hunter Rick Deckard is stalking a group of androids returned from space with short life spans and murder on their minds--where Scott''s Deckard was Harrison Ford, Dick''s is a financially over-stretched municipal employee with bills to pay and a depressed wife. In a world where most animals have died, and pet-keeping is a social duty, he can only afford a robot imitation, unless he gets a big financial break. The genetically warped "chickenhead" John Isidore has visions of a tomb-world where entropy has finally won. And everyone plugs in to the spiritual agony of Mercer, whose sufferings for the sins of humanity are broadcast several times a day. Prefiguring the religious obsessions of Dick''s last novels, this asks dark questions about identity and altruism. After all, is it right to kill the killers just because Mercer says so?');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-34553-195-7', 'The Partner', '14.99', 'Thriller', , 9, 'Der unerschrockene Schreiber dieser Kritik ist nicht der einzige -- wohl eher einer von Millionen oder Milliarden von Lesern -- der sich die Nacht um die Ohren schlägt, um John Grishams neustes Buch Der Partner zu Ende zu lesen. Es "ermordet den Schlaf", um Shakespeare (Macbeth) zu paraphrasieren. Wenn darauf die Todesstrafe stünde, wäre Grisham schon längst auf dem elektrischen Stuhl gelandet. Seine neuste "Filmvorlage" dreht sich um den Rechtsanwalt Patrick Lanigan aus Biloxi im US-Bundesstaat Mississippi. Dieser täuscht seinen Tod vor, beobachtet von einem nahegelegenen Baum aus seine eigene Beerdigung (netter Einfall) und setzt sich dann mit satten 90 Millionen Dollar nach Brasilien ab. Aber Berge von Geld verschwinden nicht so leicht wie Rechtsanwälte aus Biloxi, und Lanigan wird verhaftet. Darauf folgt ein Blitzgewitter von Täuschungsmanövern, Rechtsstreitigkeiten und Zug-um-Zug-Strategien. Genau die Art von Spiel mit hohem Einsatz, die zu Grishams festem Repertoire gehört. Außer der üblichen Liebesbeziehung (Lanigans Komplizin, eine schöne Rechtsanwältin aus Rio de Janeiro) sind die Hauptakteure in Der Partner zu 100% Männer, die alle stark an Grisham selbst erinnern. Leidenschaft gibt es wenig bis gar nicht, und die Auflösung ist raffiniert. Große Gefühle müssen Sie woanders suchen, aber wenn Sie darauf brennen zu erfahren, was im Film geschieht, bevor dieser überhaupt gedreht ist, dann wird Sie Der Partner auf jeden Fall zufriedenstellen. ');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-39507-122-9', 'The Hobbit', '14.00', 'Fantasy', , 3, 'This is the prelude to "The Lord of the Rings". Bilbo Baggins is a hobbit who enjoys a comfortable, unambitious life. But his contentment is disturbed when the wizard, Gandalf, and a company of dwarves arrive on his doorstep to take him on an adventure.');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-42524-033-5', 'The Hunt for Red October', '18.99', 'Thriller', , 10, 'Somewhere under the Atlantic, a Soviet submarine commander has just made a fateful decision: the Red October is heading west. The Americans want her. The Russians want her back. And the most incredible chase in history is on. \r\n\r\nThe Hunt for Red October is the runaway bestseller that launched Tom Clancy''s phenomenal career. A military thriller so accurate and convincing that the author was rumoured to have been debriefed by the White House. Its theme: the greatest espionage coup in history. Its story: the chase for a runaway, top secret Russian missile submarine.');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-44024-595-7', 'The Street Lawyer', '14.99', 'Thriller', , 9, 'Wie der Titel bereits andeutet, geht es in John Grishams neuestem Roman wieder einmal um das amerikanische Rechts- bzw. Unrechtssystem. Zum zentralen Thema hat der Baron des "Legal Thriller" diesmal Amerikas Obdachlose auserkoren, die in einer Welt, die von großen und mächtigen Anwaltskanzleien regiert wird, nur unzulänglich vertreten werden.\r\n\r\nDas Buch erzählt die Geschichte des Protagonisten Michael Brock, einem Anwalt, der kurz davor steht, bei Sweeny & Drake, einer der renommiertesten Anwaltskanzleien Washingtons, einzusteigen. Sein Traum vom Millionen-Dollar-Gehalt ist in greifbarer Nähe. Nichts kann ihn mehr aufhalten, weder die 90-Stunden-Woche noch seine gescheiterte Ehe -- bis er eines Tages auf DeVon Hardy alias "Mister" trifft, einen Vietnam-Veteranen, der auf seinen Vermieter wütend ist und zudem noch ein paar Anwälte in die Pfanne hauen will. Während eines Meetings nimmt Hardy ohne ersichtlichen Grund Brock und acht seiner Kollegen als Geisel, verlangt deren Steuererklärungen und verhört sie mit einer Überzeugung, die selbst spanische Inquisitoren vor Neid hätten erblassen lassen. Während Hardy, ein Mann weniger Worte aber viel Munition, mit einer Schnellfeuerwaffe größeren Kalibers nur wenige Zentimeter vor Brocks Gesicht herumfuchtelt, nuschelt er geheimnisvoll: "Wer sind die Verantwortlichen für die Räumung?".');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-45119-114-4', 'Atlas Shrugged', '17.40', 'Science Fiction', , 11, 'Published in 1957, "Atlas Shrugged" was Ayn Rand''s greatest achievement and last work of fiction. In this novel, she dramatizes her unique philosophy through an intellectual mystery story that integrates ethics, metaphysics, epistemology, politics, economics, and sex. Set in a near-future U.S.A. whose economy is collapsing as a result of the mysterious disappearance of leading innovators and industrialists, this novel presents an astounding panorama of human life - from the productive genius who becomes a worthless playboy to the great steel industrialist who does not know that he is working for his own destruction to the philosopher who becomes a pirate to the woman who runs a transcontinental railroad to the lowest track worker in her train tunnels. Peopled by larger-than-life heroes and villains, charged with towering questions of good and evil, "Atlas Shrugged" is a philosophical revolution told in the form of an action thriller. ');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-48645-401-6', 'Dracula', '19.99', 'Horror', , 5, 'Dracula is an 1897 Gothic horror novel by Irish author Bram Stoker. Famous for introducing the character of the vampire Count Dracula, the novel tells the story of Dracula''s attempt to move from Transylvania to England so he may find new blood and spread undead curse, and the battle between Dracula and a small group of men and women led by Professor Abraham Van Helsing. Dracula has been assigned to many literary genres including vampire literature, horror fiction, the gothic novel and invasion literature. The novel touches on themes such as the role of women in Victorian culture, sexual conventions, immigration, colonialism, and post-colonialism. Although Stoker did not invent the vampire, he defined its modern form, and the novel has spawned numerous theatrical, film and television interpretations.');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-0-81255-070-2', 'Ender''s Game', '15.99', 'Science Fiction', , 7, 'Intense is the word for Ender''s Game. Aliens have attacked Earth twice and almost destroyed the human species. To make sure humans win the next encounter, the world government has taken to breeding military geniuses -- and then training them in the arts of war... The early training, not surprisingly, takes the form of ''games''... Ender Wiggin is a genius among geniuses; he wins all the games... He is smart enough to know that time is running out. But is he smart enough to save the planet? ');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-1-50114-297-0', 'It', '14.99', 'Horror', , 4, 'They were seven teenagers when they first stumbled upon the horror. Now they were grown-up men and women who had gone out into the big world to gain success and happiness. But none of them could withstand the force that drew them back to Derry, Maine to face the nightmare without an end, and the evil without a name. What was it? Read It and find out...if you dare!');
INSERT INTO `buch` (`isb_nr`, `titel`, `preis`, `kategorie`, `cover`, `aid`, `beschreibung`) VALUES
('978-1591025948', 'The Blade Itself', '16.99', 'Fantasy', , 1, 'Inquisitor Glokta, a crippled and increasingly bitter relic of the last war, former fencing champion turned torturer extraordinaire, is trapped in a twisted and broken body - not that he allows it to distract him from his daily routine of torturing smugglers. Nobleman, dashing officer and would-be fencing champion Captain Jezal dan Luthar is living a life of ease by cheating his friends at cards. Vain, shallow, selfish and self-obsessed, the biggest blot on his horizon is having to get out of bed in the morning to train with obsessive and boring old men. And Logen Ninefingers, an infamous warrior with a bloody past, is about to wake up in a hole in the snow with plans to settle a blood feud with Bethod, the new King of the Northmen, once and for all - ideally by running away from it. But as he''s discovering, old habits die really, really hard indeed ...especially when Bayaz gets involved. A bald old man with a terrible temper and a pathetic assistant, he could be the First of the Magi, he could be a spectacular fraud, but whatever he is, he''s about to make the lives of Glotka, Jezal and Logen a whole lot more difficult ... ');

